import { useState } from "react";

function AddNewMoveButton() {
  const [isOpen, setIsOpen] = useState(false);
  return (
    <div>
      {!isOpen && <button onClick={() => setIsOpen(true)}>Add New Move</button>}
    </div>
  );
}

export default AddNewMoveButton;
